import React from "react";
import './contactus.css';
import Mapphoto from "../../assets/Screenshot_18.png"

const Contactus = () => {
    return (

        <div className="ccs__CU">
            <div className="ccs__CU-container">
            <div className="ccs__CU-text">Located in the Bar triangle by Brother Bikes and Drew's Tattoo Shop</div>
            <div className="ccs__CU-photo" >
            <img className="maphoto" src={Mapphoto} alt = {"mphoto"}   />
            </div>
            </div>
        </div>
    )
}
export default Contactus
